import React from 'react';

function TestDashboard({ status, logs }) {
  return (
    <div className="card">
      <h2>Test Results Dashboard</h2>
      <p><strong>Status:</strong> {status}</p>
      <h4>Test Logs & History</h4>
      <ul className="log-list">
        {logs.map((log, index) => (
          <li key={index}>{log}</li>
        ))}
      </ul>
    </div>
  );
}

export default TestDashboard;
